import "../App.css";
import 'bootstrap/dist/css/bootstrap.min.css';
import * as React from "react";
import * as Icon from 'react-bootstrap-icons';
import {Container, Row, Col, Button} from "react-bootstrap";

function Header() {
    return <div>
        <p className="header-title">MyClinic <Icon.Clipboard2Pulse /></p>
    </div>
}

function HomeContent() {
    return <Container fluid className="homeContainer">
        <Row className="homeRow">
            <Col lg={{span:4, order:1}} xs={{span:12, order:2}} className="taglineCol">
                <p className="tagline-title">SAVE THE WAITING TIME</p>
                <p className="tagline-subtitle">Book your doctor's appointment online</p>
                <ul>
                    <li>Feature 1</li>
                    <li>Feature 2</li>
                    <li>Feature 3</li>
                </ul>
            </Col>
            <Col lg={{span:8, order:2}} xs={{span:12, order:1}}>
                <img src={require("../img/doctor_clipart.jpg")} alt="clinic clipart" className="clinic_img"></img>
            </Col>
        </Row>
        <Button variant="outline-secondary" className="homeButton">Get Started</Button>
    </Container>
}

export {HomeContent, Header};
